import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';

function Home () {
    return (
        <>
            <HeroSection />
            <Switch>
                <Route path="/services">
                <ServicesPage />
                </Route>
            </Switch>
        </>
    );
};
export default Home;
